import React from "react";
import Header from "./components/share/Header";
import Router from "./shared/Router";
import Main from "./pages/Main";
function App() {
  return (
    // eslint-disable-next-line react/jsx-filename-extension
    <div>
      <Router />
      <Main />
    </div>
  );
}

export default App;
